Synopsis:
Vip At Avn Directors Cut: Ever wonder what it`s really like to be a pornstar, and live their lifestyle? Levi Cash delivers a raw undirected glimpse, into his life of being a pornstar/director in the XXX industry! This is a rare behind-the-scenes type movie, that gives you real insight into how these girls really act and of course fuck, when there are no scripts, no lights and no rules! This is all off-set when the girls are just being themselves. See what it`s like to live the Director`s Life, where all the girls are eager to please and make a name for themselves
